(110, 'Classic Kimbap (Korean Seaweed Rice Roll)', 'classic-kimbap-korean-seaweed-rice-roll', 'Cook in a single layer, flipping halfway through, until crispy and golden-brown, about 12 minutes total. You may need to work in batches depending on the size of your air fryer.', '<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; letter-spacing: 0.2px; text-align: left; background-color: rgb(255, 255, 255)\">Kimbap, sometimes spelled gimbap, is a rice, meat—usually beef—and vegetables rolled in roasted seaweed. During my childhood, when we took family road trips in our VW Hatchback, my mom would always pack kimbap in a huge Tupperware container and put it in our old Igloo cooler, along with bottles of Coke. We never stopped at gas stations or restaurants for food. We pulled over at rest stops, filled our bellies with kimbap and a Coke, and we were set!&nbsp;</span>\r\n<br /></p>\r\n<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; letter-spacing: 0.2px; text-align: left; background-color: rgb(255, 255, 255)\">Kimbap, sometimes spelled gimbap, is a rice, meat—usually beef—and vegetables rolled in roasted seaweed. During my childhood, when we took family road trips in our VW Hatchback, my mom would always pack kimbap in a huge Tupperware container and put it in our old Igloo cooler, along with bottles of Coke. We never stopped at gas stations or restaurants for food. We pulled over at rest stops, filled our bellies with kimbap and a Coke, and we were set!&nbsp;</span>\r\n<br /></p>\r\n<p>\r\n\r\n<span style=\"color: rgb(34, 34, 34); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; letter-spacing: 0.2px; text-align: left; background-color: rgb(255, 255, 255)\">Kimbap, sometimes spelled gimbap, is a rice, meat—usually beef—and vegetables rolled in roasted seaweed. During my childhood, when we took family road trips in our VW Hatchback, my mom would always pack kimbap in a huge Tupperware container and put it in our old Igloo cooler, along with bottles of Coke. We never stopped at gas stations or restaurants for food. We pulled over at rest stops, filled our bellies with kimbap and a Coke, and we were set!&nbsp;</span>\r\n<br /></p>', 'upload/blogs/1057087643.webp', 11, 3, '1', '2', '', '', '2023-08-23 11:14:34', '2023-08-23 11:14:34'),
(111, 'Classic Kimbap Ingredients', 'classic-kimbap-ingredients', 'Kimbap uses sheets of roasted seaweed—the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It’s a perfect balance of sweet and savory flavors. You won’t even need a dipping sauce.', '<p>Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.Kimbap uses sheets of roasted seaweed&mdash;the packaging is sometimes labeled as nori. The rice is always seasoned with sesame oil, and popular filling ingredients include cooked carrots, cucumbers, strips of cooked eggs, a protein such as steak or spam, and fresh or pickled vegetables, like danmuji. It&rsquo;s a perfect balance of sweet and savory flavors. You won&rsquo;t even need a dipping sauce.</p>', 'upload/blogs/1369543951.webp', 11, 3, '1', '2', '', '', '2023-08-23 11:15:25', '2023-08-23 11:21:09'),
(112, 'What Is Danmuji?', 'what-is-danmuji', 'Danmuji is a bright yellow pickled daikon radish. The pickle brine has rice vinegar, sugar, seasonings, and turmeric, for an iconic yellow color. It is poured over daikon sliced into rounds, sticks, or even left whole. This bright, acidic, sweet pickle is popular as a banchan or as an ingredient in kimbap.', '<p>Danmuji is a bright yellow pickled daikon radish. The pickle brine has rice vinegar, sugar, seasonings, and turmeric, for an iconic yellow color. It is poured over daikon sliced into rounds, sticks, or even left whole. This bright, acidic, sweet pickle is popular as a banchan or as an ingredient in kimbap.\r\n\r\nYou can find danmuji in most Asian markets. I buy it at my local Hmart. It is sold in refrigerated packages, whole, sliced into rounds, or cut in long strips, specifically for kimbap. Once opened, leftover danmuji will keep for up to 2 weeks. Transfer it into an airtight container with its original brine and keep it refrigerated.<br /></p>\r\n<p>13\" class=\"comp mntl-sc-block mntl-sc-block-adslot mntl-block\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; text-align: left; color: rgb(34, 34, 34); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 0.2px; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"&gt;<p id=\"mntl-sc-block_1-0-14\" class=\"comp mntl-sc-block mntl-sc-block-html\" style=\" margin: 0px 0px 1rem; letter-spacing: 0.2px; counter-reset: section 0; text-align: left; color: rgb(34, 34, 34); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; background-color: rgb(255, 255, 255)\">You can find danmuji in most Asian markets. I buy it at my local<span>&nbsp;</span><a href=\"https://www.hmart.com/27010003\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"externalLink\" data-ordinal=\"1\" target=\"_blank\" rel=\"noopener\" style=\" text-decoration: none; background-image: linear-gradient(to right, teal 0px, teal 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; transition: background-image 0.25s ease 0s, color 0.25s ease 0s; color: teal\">Hmart</a>. It is sold in refrigerated packages, whole, sliced into rounds, or cut in<span>&nbsp;</span><a href=\"https://www.hmart.com/pickled-radish-27311\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"externalLink\" data-ordinal=\"2\" target=\"_blank\" rel=\"noopener\" style=\" text-decoration: none; background-image: linear-gradient(to right, teal 0px, teal 100%); background-position: 0px 97%; background-repeat: repeat-x; background-size: 100% 1px; transition: background-image 0.25s ease 0s, color 0.25s ease 0s; color: teal\">long strips</a>, specifically for kimbap. Once opened, leftover danmuji will keep for up to 2 weeks. Transfer it into an airtight container with its original brine and keep it refrigerated.</p>\r\n<br /></p>', 'upload/blogs/1220055817.webp', 11, 3, '1', '2', '', '', '2023-08-23 11:17:49', '2023-08-23 11:17:49'),
